  [],\n\t\"revision_timestamp\": \"2016-08-04T08:18:02.258876\",\n\t\"name\": \"izembek-national-wildlife-refuge-annual-narrative-report-calendar-year-1981\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Izembek,
  Eastern Aleutians, Semidi, and Simeonof NWRs outlines Refuge accomplishments during
  the 1981 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the master plan, management planning, public participation,
  and research and investigations. Refuge administration is outlined; information
  about personnel, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, grazing, and wilderness areas. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, marine
  mammals, fisheries resources, surplus animal disposal, scientific collections, marking
  and bird banding, and disease control. The public uses of the Refuge described in
  this report include interpretive programs, hunting, fishing, trapping, wildlife
  observation, outdoor recreation, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, major maintenance,
  equipment replacement, and communication systems. Cooperative programs and items
  of interest are provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
